import React from 'react'
import { Link } from 'react-router-dom'
import './BookList.css'

const Book = (Book) => {
  return (
    <div>
      <div>
        <img src = {Book.cover_img} alt = 'book cover' />
      </div>
    </div>
  )
}

export default Book
